CREATE DATABASE MSCNHAutoCrivo;

use MSCNHAutoCrivo;

create table tb_extrato_cnh
(
    id_extrato       bigint auto_increment
        primary key,
    fk_ctd_id        bigint                              null,
    fk_prf_id        bigint                              null,
    requisicao       longtext                            null,
    resposta         longtext                            null,
    tipo_resposta    varchar(255)                        null,
    ek_contrato_id   bigint                              null,
    data_hora_insert timestamp default CURRENT_TIMESTAMP not null,
    dado_consultado  varchar(100)                        null,
    ek_produto_id    bigint                              null
)
    engine = InnoDB;

